import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './MainPage.css'; // Import CSS file for styling
import logo from './logo.png'; // Assume you have a logo image for the hospital

const MainPage = () => {
  const [activeSection, setActiveSection] = useState(null); // State for the active section
  const navigate = useNavigate();

  const handleSectionClick = (section) => {
    setActiveSection(activeSection === section ? null : section); // Toggle section visibility
  };

  const handleRoleClick = (role) => {
    navigate(`/${role}`);
  };

  return (
    <div>
      {/* Header Section */}
      <header className="header">
        <div className="header-content">
          <img src={logo} alt="Hospital Logo" className="logo" />
          <div className="header-info">
            <span>Emergency: <strong>1800 102 9102</strong></span>
            <span>Helpline: <strong>1800 102 9103</strong></span>
          </div>
        </div>
        <nav className="nav-bar">
          <ul>
            <li onClick={() => handleSectionClick('about')}>About Us</li>
            <li onClick={() => handleSectionClick('contact')}>Contact Us</li>
            <li onClick={() => handleSectionClick('locations')}>Locations</li>
            <li>
              <select>
                <option>Select Language</option>
                <option>English</option>
                <option>Hindi</option>
              </select>
            </li>
          </ul>
        </nav>
      </header>

      {/* Dynamic Content Based on Clicked Section */}
      <div className="dynamic-content">
        {activeSection === 'about' && (
          <div className="section-content">
            <h2>About Us</h2>
            <p>
              Welcome to our hospital! We are dedicated to providing top-quality care to all our patients
              with the latest medical technology and a compassionate approach.
            </p>
          </div>
        )}
        {activeSection === 'contact' && (
          <div className="section-content">
            <h2>Contact Us</h2>
            <p>Phone: 1800 102 9103<br/>Email: contact@hospital.com</p>
          </div>
        )}
        {activeSection === 'locations' && (
          <div className="section-content">
            <h2>Locations</h2>
            <p>Find our hospital branches in New Delhi, Mumbai, and Bengaluru.</p>
          </div>
        )}
      </div>

      {/* Main Content with Circular Options */}
      <div className="main-page">
        <h1 className="welcome-text">Welcome to the Hospital Portal</h1>
        <div className="options">
          <button className="role-button" onClick={() => handleRoleClick('nurse')}>Nurse</button>
          <button className="role-button" onClick={() => handleRoleClick('junior-doctor')}>Junior Doctor</button>
          <button className="role-button" onClick={() => handleRoleClick('senior-doctor')}>Senior Doctor</button>
        </div>
      </div>
    </div>
  );
};

export default MainPage;
